import React, { useEffect, useState } from "react";
import styled, { keyframes } from "styled-components";

const helloWorldAnimation = keyframes`
    0% {
        transform: rotate(15deg);
        opacity: 0;
    }

    100% {
        opacity: 1;
    }
`;

const AboutSectionStyles = styled.section`
  margin: 0 auto;
  position: relative;
  max-width: 1145px;
  min-height: 50vh;
  display: flex;
  justify-content: center;
  -webkit-box-align: center;
  flex-direction: row;
  align-items: flex-start;
  padding: 0 25px;

  section {
    position: relative;
    top: 0px;
    width: 100%;
    padding: 200px 0 0 0;
    font-family: proxima-nova, sans-serif;
  }

  .title-bar {
    display: flex;
    width: 65%;
    margin: 0 auto;
    align-items: center;
    gap: 15px;
  }

  .title-bar h2 {
    font-weight: 500;
    margin: 0;
    font-size: 1.75rem;
    font-family: proxima-nova, sans-serif;
  }

  .title-bar_line {
    position: relative;
    top: 3px;
    height: 1px;
    width: 60%;
    background: #707070;
  }

  .about-wrapper {
    display: flex;
    max-width: 100%;
    margin: 0 auto;
    justify-content: space-around;
  }

  .text-wrap {
    flex: 0.65;
    margin: 30px 15px;
    position: relative;
    font-weight: 100;
    left: 160px;
  }

  .svg-wrapper {
    position: relative;
    left: 75px;
    top: 20px;
  }

  .hello-world-text {
    position: absolute;
    top: 90px;
    left: 150px;
    font-size: 2rem;
    width: 50%;
    font-family: "omnes-greek", sans-serif;
    font-weight: 400;
    color: #8fb3a3;
  }

  .animateHello {
    animation-name: ${helloWorldAnimation};
    animation-duration: 1s;
    animation-iteration-count: once;
  }

  .face-two {
    display: none;
  }

  @media (min-width: 819px) { 
    .text-wrap {
      left: 120px;
    }

    .svg-wrapper {
        left: 60px;
    }
  }


  @media (max-width: 768px) {
    .about-wrapper {
      flex-direction: column;
      width: 75%;
    }

    .face-one {
      display: none;
    }

    .text-wrap {
      left: 0px;
    }

    .face-two {
      display: block;
    }

    .hello-world-text {
      position: absolute;
      top: 60px;
      left: 130px;
      font-size: 1.3rem;
      width: 50%;
      font-family: "omnes-greek", sans-serif;
      font-weight: 400;
      color: #8fb3a3;
    }

    .title-bar h2 {
    margin: 10px 0;
    font-size: 1.75rem;
    line-height: 2rem;
    text-align: center;
}
  }
`;

