            <p>
              Hey there, my name is Ahmed and I am a self-taught front end
              developer that is currently working out of Philadelphia,
              Pennsylvania.
              <br />
              <br />I was born in Sudan but raised in the states and as a first
              generation immigrant I've had the privilege of integrating two
              cultures into one and finding inspiration from that{" "}
              <span id="cohesion" className="special-span">
                cohesion
              </span>{" "}
              throughout my life. My goal from the first line of code I’ve ever
              written was to someday be able to translate all these bits and
              pixels into something that incorporates parts of my personality
              while being aesthetically pleasing and functionally sound.
              <br />
              <br />
              When I'm not developing (or working through my latest headache
              from debugging one of my projects) I am usually writing a bit of
              poetry, playing guitar or watching some anime.
            </p>
